import React from 'react';
import menu from './menu.jpeg';
import food_icon from './food_icon.jpg';

export class Menu2 extends React.Component {
    render() {
        return (
            <div className="container-fluid">
                <img src={menu} />
                <div className="container">
                <div class="card">
                    <div className="row">
                        <div className="col-lg-6">
                            <h3>Our Best Food Recipes</h3>
                            <h3>Best offers from the house chef</h3>
                            <img src={food_icon} style={{height: 40, width: 40, float: 'left'}} />
                            <h5 style={{float: 'right'}}>$20</h5>
                            
                        </div>
                        <div className="col-lg-6">
                            <h3>Our Best Food Recipes</h3>
                            <h3>Best offers from the house chef</h3>
                            
                        </div>
                    </div>                        
                </div>
                </div>
            </div>
        );
    }
}
